// 340. Longest Substring with At Most K Distinct Characters
//
// Given a string, find the length of the longest substring T that contains 
// at most k distinct characters.
//
// For example, Given s = “eceba” and k = 2,
//
// T is "ece" which its length is 3.
//
// Companies asking this question:
//      Google - Editor's choice: Frequently asked in Google phone and onsite interview.

/**
 * @param {string} s
 * @param {number} k
 * @return {number}
 */
var lengthOfLongestSubstringKDistinct = function(s, k) {
    if ((s.length === 0) || (k === 0)) {
        return 0;
    }
    
    let distinctChar = new Set();
    let length = 0;
    let longestLength = 0;
    let index = 0;

    for (let i = 0; i < s.length; i++) {
        length = 0;
        distinctChar.clear();
        index = i;

        while ((index < s.length) && (distinctChar.add(s[index]).size <= k)) {
            length++;
            index++;
        }

        if (length > longestLength) {
            longestLength = length;
        }
    }

    return longestLength;
}

function test(func) {
    console.log("Testing lengthOfLongestSubstringKDistinct(s, k)...\n");

    let s, k, result;

    s = 'bacc';
    k = 2;
    result = func(s, k);
    console.log('Expected: 3');
    console.log('Output:   ' + result);

    s = 'eceba';
    k = 2;
    result = func(s, k);
    console.log('Expected: 3');
    console.log('Output:   ' + result);

    s = '';
    k = 0;
    result = func(s, k);
    console.log('Expected: 0');
    console.log('Output:   ' + result);

    s = 'a';
    k = 0;
    result = func(s, k);
    console.log('Expected: 0');
    console.log('Output:   ' + result);

    s = 'a';
    k = 1;
    result = func(s, k);
    console.log('Expected: 1');
    console.log('Output:   ' + result);

    s = 'abbbacaabababcccbbbcccaaabababbbabaaabbbaa';
    k = 2;
    result = func(s, k);
    console.log('Expected: 20');
    console.log('Output:   ' + result);

    let start = new Date();
    s = '\
    \
    \
    \
    \
    BbaABbBAaAaAbbbbABBBaBABAbbaAAbBbAbBBaaB';
    k = 34;
    result = func(s, k);
    console.log('Expected: 7365');
    console.log('Output:   ' + result);
    let end = new Date();
    console.log('Operation took ' + (end.getTime() - start.getTime()) + ' msec');
}

test(lengthOfLongestSubstringKDistinct);
